import React from "react";
import CardResturant from "../../../CardResturant/CardResturant";
import carlo from "../../../imges/clarodesktop.png";

const PopularRestaurant: React.FC = () => {
  return (
    <div>
      <CardResturant name="Claro" img={carlo} chef="Ran Shmueli" rating={4} />
      <CardResturant name="Claro" img={carlo} chef="Ran Shmueli" rating={4} />
      <CardResturant name="Claro" img={carlo} chef="Ran Shmueli" rating={4} />
    </div>
  );
};

export default PopularRestaurant;
